u0441\u043a\u0443\u044e<\/a> \u043f\u0440\u0438\u0440\u043e\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BB%D0%BD%D0%B8%D1%8F\" title=\"\u041c\u043e\u043b\u043d\u0438\u044f\">\u043c\u043e\u043b\u043d\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1763_%D0%B3%D0%BE%D0%B4\" title=\"1763 \u0433\u043e\u0434\">1763<\/a>&#160;\u2014 \u0438\u0437-\u0437\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%B8%D1%82%D1%80%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%B7%D0%B0%D0%B3%D0%BE%D0%B2%D0%BE%D1%80\" class=\"mw-redirect\" title=\"\u0425\u0438\u0442\u0440\u043e\u0432\u0441\u043a\u0438\u0439 \u0437\u0430\u0433\u043e\u0432\u043e\u0440\">\u0445\u0438\u0442\u0440\u043e\u0432\u0441\u043a\u043e\u0433\u043e \u0434\u0435\u043b\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%BA%D0%B0%D1%82%D0%B5%D1%80%D0%B8%D0%BD%D0%B0_II\" title=\"\u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0430 II\">\u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0430 II<\/a> \u0438\u0437\u0434\u0430\u043b\u0430 \u043c\u0430\u043d\u0438\u0444\u0435\u0441\u0442, \u0437\u0430\u043f\u0440\u0435\u0449\u0430\u044e\u0449\u0438\u0439 \u043f\u0440\u043e\u0438\u0437\u043d\u0435\u0441\u0435\u043d\u0438\u0435 \u043d\u0435\u043e\u0431\u0434\u0443\u043c\u0430\u043d\u043d\u044b\u0445 \u0440\u0435\u0447\u0435\u0439, \u043e\u043f\u0430\u0441\u043d\u044b\u0445 \u0434\u043b\u044f \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u0441\u043f\u043e\u043a\u043e\u0439\u0441\u0442\u0432\u0438\u044f.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1830_%D0%B3%D0%BE%D0%B4\" title=\"1830 \u0433\u043e\u0434\">1830<\/a>&#160;\u2014 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D1%83%D0%BC%D0%BD%D0%BE%D0%B9_%D0%B1%D1%83%D0%BD%D1%82_%D0%B2_%D0%A1%D0%B5%D0%B2%D0%B0%D1%81%D1%82%D0%BE%D0%BF%D0%BE%D0%BB%D0%B5_(1830)\" title=\"\u0427\u0443\u043c\u043d\u043e\u0439 \u0431\u0443\u043d\u0442 \u0432 \u0421\u0435\u0432\u0430\u0441\u0442\u043e\u043f\u043e\u043b\u0435 (1830)\">\u0427\u0443\u043c\u043d\u043e\u0439 \u0431\u0443\u043d\u0442<\/a>\u00bb \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B0%D1%81%D1%82%D0%BE%D0%BF%D0%BE%D0%BB%D1%8C\" title=\"\u0421\u0435\u0432\u0430\u0441\u0442\u043e\u043f\u043e\u043b\u044c\">\u0421\u0435\u0432\u0430\u0441\u0442\u043e\u043f\u043e\u043b\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1836_%D0%B3%D0%BE%D0%B4\" title=\"1836 \u0433\u043e\u0434\">1836<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%80%D0%BA%D0%B0%D0%BD%D0%B7%D0%B0%D1%81\" title=\"\u0410\u0440\u043a\u0430\u043d\u0437\u0430\u0441\">\u0410\u0440\u043a\u0430\u043d\u0437\u0430\u0441<\/a> \u0441\u0442\u0430\u043b 25-\u043c \u0448\u0442\u0430\u0442\u043e\u043c \u0421\u0428\u0410.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1844_%D0%B3%D0%BE%D0%B4\" title=\"1844 \u0433\u043e\u0434\">1844<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%83%D0%B4%D1%8C%D0%B8%D1%80,_%D0%A7%D0%B0%D1%80%D0%BB%D1%8C%D0%B7\" title=\"\u0413\u0443\u0434\u044c\u0438\u0440, \u0427\u0430\u0440\u043b\u044c\u0437\">\u0427\u0430\u0440\u043b\u044c\u0437 \u0413\u0443\u0434\u044c\u0438\u0440<\/a> \u0437\u0430\u043f\u0430\u0442\u0435\u043d\u0442\u043e\u0432\u0430\u043b \u0441\u043f\u043e\u0441\u043e\u0431 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%83%D0%BB%D0%BA%D0%B0%D0%BD%D0%B8%D0%B7%D0%B0%D1%86%D0%B8%D1%8F\" title=\"\u0412\u0443\u043b\u043a\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f\">\u0432\u0443\u043b\u043a\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%B7%D0%B8%D0%BD%D0%B0\" title=\"\u0420\u0435\u0437\u0438\u043d\u0430\">\u0440\u0435\u0437\u0438\u043d\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1846_%D0%B3%D0%BE%D0%B4\" title=\"1846 \u0433\u043e\u0434\">1846<\/a>&#160;\u2014 \u0411\u0440\u0438\u0442\u0430\u043d\u0438\u044f \u0438 \u0421\u0428\u0410 \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%80%D0%B5%D0%B3%D0%BE%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%B4%D0%BE%D0%B3%D0%BE%D0%B2%D0%BE%D1%80\" title=\"\u041e\u0440\u0435\u0433\u043e\u043d\u0441\u043a\u0438\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440\">\u041e\u0440\u0435\u0433\u043e\u043d\u0441\u043a\u0438\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440<\/a>, \u043f\u043e \u043a\u043e\u0442\u043e\u0440\u043e\u043c\u0443 \u0433\u0440\u0430\u043d\u0438\u0446\u0430 \u043c\u0435\u0436\u0434\u0443 \u0421\u0428\u0410 \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B0%D0%B4%D0%B0\" title=\"\u041a\u0430\u043d\u0430\u0434\u0430\">\u041a\u0430\u043d\u0430\u0434\u043e\u0439<\/a> \u0443\u0441\u0442\u0430\u043d\u0430\u0432\u043b\u0438\u0432\u0430\u043b\u0430\u0441\u044c \u043f\u043e 49-\u0439 \u043f\u0430\u0440\u0430\u043b\u043b\u0435\u043b\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1851_%D0%B3%D0%BE%D0%B4\" title=\"1851 \u0433\u043e\u0434\">1851<\/a>&#160;\u2014 \u043c\u043e\u043b\u043e\u0447\u043d\u0438\u043a \u0414\u0436\u0435\u043a\u043e\u0431 \u0424\u0443\u0441\u0441\u0435\u043b\u044c \u043e\u0441\u043d\u043e\u0432\u0430\u043b \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%BB%D1%82%D0%B8%D0%BC%D0%BE%D1%80\" title=\"\u0411\u0430\u043b\u0442\u0438\u043c\u043e\u0440\">\u0411\u0430\u043b\u0442\u0438\u043c\u043e\u0440\u0435<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a>, \u0448\u0442\u0430\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%8D%D1%80%D0%B8%D0%BB%D0%B5%D0%BD%D0%B4\" title=\"\u041c\u044d\u0440\u0438\u043b\u0435\u043d\u0434\">\u041c\u044d\u0440\u0438\u043b\u0435\u043d\u0434<\/a>) \u043f\u0435\u0440\u0432\u0443\u044e \u0432 \u043c\u0438\u0440\u0435 \u0444\u0430\u0431\u0440\u0438\u043a\u0443 \u043f\u043e \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0441\u0442\u0432\u0443 \u043c\u043e\u0440\u043e\u0436\u0435\u043d\u043e\u0433\u043e .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1867_%D0%B3%D0%BE%D0%B4\" title=\"1867 \u0433\u043e\u0434\">1867<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D0%B4%D0%B8%D0%B0%D0%BD%D0%B0%D0%BF%D0%BE%D0%BB%D0%B8%D1%81\" title=\"\u0418\u043d\u0434\u0438\u0430\u043d\u0430\u043f\u043e\u043b\u0438\u0441\">\u0418\u043d\u0434\u0438\u0430\u043d\u0430\u043f\u043e\u043b\u0438\u0441\u0435<\/a> \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u043c \u0432\u0440\u0430\u0447\u043e\u043c \u0414\u0436\u043e\u043d\u043e\u043c \u0411\u043e\u0431\u0431\u0441\u043e\u043c (John Stough Bobbs) \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u043f\u0440\u043e\u0432\u0435\u0434\u0435\u043d\u0430 \u0443\u0441\u043f\u0435\u0448\u043d\u0430\u044f \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f \u043f\u043e \u0443\u0434\u0430\u043b\u0435\u043d\u0438\u044e \u0436\u0435\u043b\u0447\u043d\u043e\u0433\u043e \u043a\u0430\u043c\u043d\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1869_%D0%B3%D0%BE%D0%B4\" title=\"1869 \u0433\u043e\u0434\">1869<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%B0%D0%B9%D0%B0%D1%82,_%D0%94%D0%B6%D0%BE%D0%BD\" title=\"\u0425\u0430\u0439\u0430\u0442, \u0414\u0436\u043e\u043d\">\u0414\u0436\u043e\u043d \u0425\u0430\u0439\u0430\u0442<\/a> (John Wesley Hyatt) \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%BB%D0%B1%D0%B0%D0%BD%D0%B8_(%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA)\" title=\"\u041e\u043b\u0431\u0430\u043d\u0438 (\u041d\u044c\u044e-\u0419\u043e\u0440\u043a)\">\u041e\u043b\u0431\u0430\u043d\u0438<\/a> (\u0448\u0442\u0430\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA\" title=\"\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\">\u041d\u044c\u044e-\u0419\u043e\u0440\u043a<\/a>) \u0437\u0430\u043f\u0430\u0442\u0435\u043d\u0442\u043e\u0432\u0430\u043b \u0446\u0435\u043b\u043b\u0443\u043b\u043e\u0438\u0434.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1878_%D0%B3%D0%BE%D0%B4\" title=\"1878 \u0433\u043e\u0434\">1878<\/a>&#160;\u2014 \u0432 \u0421\u0428\u0410 \u0441\u0434\u0435\u043b\u0430\u043d\u0430 \u043f\u0435\u0440\u0432\u0430\u044f \u043f\u043e\u043f\u044b\u0442\u043a\u0430 \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0441\u0442\u0432\u0430 \u043f\u043e\u0434\u043e\u0431\u0438\u044f \u0444\u0438\u043b\u044c\u043c\u0430 (12 \u0444\u043e\u0442\u043e\u043a\u0430\u043c\u0435\u0440 \u043e\u0434\u043d\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u043e \u0437\u0430\u0444\u0438\u043a\u0441\u0438\u0440\u043e\u0432\u0430\u043b\u0438 \u043e\u0434\u0438\u043d \u043a\u0430\u0434\u0440 \u0441 \u0442\u0435\u043c, \u0447\u0442\u043e\u0431\u044b \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0438\u0442\u044c, \u0432\u0441\u0435 \u043b\u0438 \u0447\u0435\u0442\u044b\u0440\u0435 \u043a\u043e\u043f\u044b\u0442\u0430 \u043e\u0442\u0440\u044b\u0432\u0430\u044e\u0442\u0441\u044f \u043e\u0442 \u0437\u0435\u043c\u043b\u0438 \u043f\u0440\u0438 \u043b\u043e\u0448\u0430\u0434\u0438\u043d\u043e\u043c \u0433\u0430\u043b\u043e\u043f\u0435).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1898_%D0%B3%D0%BE%D0%B4\" title=\"1898 \u0433\u043e\u0434\">1898<\/a>&#160;\u2014 \u0432 \u0421\u0428\u0410 \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B0%D0%BD%D1%82%D0%B8%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D0%BB%D0%B8%D0%B3%D0%B0\" class=\"mw-redirect\" title=\"\u0410\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u0430\u043d\u0442\u0438\u0438\u043c\u043f\u0435\u0440\u0441\u043a\u0430\u044f \u043b\u0438\u0433\u0430\">\u0410\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u0430\u043d\u0442\u0438\u0438\u043c\u043f\u0435\u0440\u0441\u043a\u0430\u044f \u043b\u0438\u0433\u0430<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D1%8F%D0%B7%D1%8B%D0%BA\" title=\"\u0410\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 \u044f\u0437\u044b\u043a\">\u0430\u043d\u0433\u043b.<\/a>&#160;American Anti-Imperialist League), \u0441\u0442\u0430\u0432\u0438\u0432\u0448\u0430\u044f \u0446\u0435\u043b\u044c\u044e \u0431\u043e\u0440\u044c\u0431\u0443 \u043f\u0440\u043e\u0442\u0438\u0432 \u0437\u0430\u0445\u0432\u0430\u0442\u043d\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u043f\u043e\u043b\u0438\u0442\u0438\u043a\u0438 \u0421\u0428\u0410 \u0432 \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u0438 \u0424\u0438\u043b\u0438\u043f\u043f\u0438\u043d\u0441\u043a\u0438\u0445 \u043e\u0441\u0442\u0440\u043e\u0432\u043e\u0432, \u0430 \u043f\u043e\u0437\u0434\u043d\u0435\u0435 \u0438 \u041a\u0443\u0431\u044b. \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1901\" class=\"mw-redirect\" title=\"1901\">1901<\/a>\u2014<a href=\"https:\/\/ru.wikipedia.org\/wiki\/1910\" class=\"mw-redirect\" title=\"1910\">1910<\/a> \u0432\u0438\u0446\u0435-\u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u043e\u043c \u041b\u0438\u0433\u0438 \u0431\u044b\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D0%BA_%D0%A2%D0%B2%D0%B5%D0%BD\" title=\"\u041c\u0430\u0440\u043a \u0422\u0432\u0435\u043d\">\u041c\u0430\u0440\u043a \u0422\u0432\u0435\u043d<\/a>. \u0420\u0430\u0441\u043f\u0443\u0449\u0435\u043d\u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1921\" class=\"mw-redirect\" title=\"1921\">1921<\/a>.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1904_%D0%B3%D0%BE%D0%B4\" title=\"1904 \u0433\u043e\u0434\">1904<\/a><\/li><\/ul>&#160;\u2014 \u043e\u0441\u043d\u043e\u0432\u0430\u043d \u0444\u0443\u0442\u0431\u043e\u043b\u044c\u043d\u044b\u0439 \u043a\u043b\u0443\u0431 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%B9%D0%B5%D1%80_04_(%D1%84%D1%83%D1%82%D0%B1%D0%BE%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%BA%D0%BB%D1%83%D0%B1)\" title=\"\u0411\u0430\u0439\u0435\u0440 04 (\u0444\u0443\u0442\u0431\u043e\u043b\u044c\u043d\u044b\u0439 \u043a\u043b\u0443\u0431)\">\u0411\u0430\u0439\u0435\u0440<\/a>\u00bb (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D0%B2%D0%B5%D1%80%D0%BA%D1%83%D0%B7%D0%B5%D0%BD\" title=\"\u041b\u0435\u0432\u0435\u0440\u043a\u0443\u0437\u0435\u043d\">\u041b\u0435\u0432\u0435\u0440\u043a\u0443\u0437\u0435\u043d<\/a>).&#160;\u2014 \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u0430 \u043e\u0434\u043d\u0430 \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D1%83%D0%BF%D0%BD%D0%B5%D0%B9%D1%88%D0%B8%D0%B5_%D0%BC%D0%BE%D1%80%D1%81%D0%BA%D0%B8%D0%B5_%D0%BA%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D1%8B_XX_%D0%B2%D0%B5%D0%BA%D0%B0\" title=\"\u041a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0438\u0435 \u043c\u043e\u0440\u0441\u043a\u0438\u0435 \u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u044b XX \u0432\u0435\u043a\u0430\">\u043a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0438\u0445 \u043c\u043e\u0440\u0441\u043a\u0438\u0445 \u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444 XX \u0432\u0435\u043a\u0430<\/a>: \u0432 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%B6%D0%B0%D1%80\" title=\"\u041f\u043e\u0436\u0430\u0440\">\u043f\u043e\u0436\u0430\u0440\u0430<\/a> \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D1%82-%D0%A0%D0%B8%D0%B2%D0%B5%D1%80\" title=\"\u0418\u0441\u0442-\u0420\u0438\u0432\u0435\u0440\">\u0418\u0441\u0442-\u0420\u0438\u0432\u0435\u0440<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA\" title=\"\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\">\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\u0435<\/a> \u0432\u0441\u043f\u044b\u0445\u043d\u0443\u0432\u0448\u0435\u0433\u043e \u043d\u0430 \u043f\u0430\u0441\u0441\u0430\u0436\u0438\u0440\u0441\u043a\u043e\u043c \u043a\u043e\u043b\u0435\u0441\u043d\u043e\u043c \u043f\u0430\u0440\u043e\u0445\u043e\u0434\u0435 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%93%D0%B5%D0%BD%D0%B5%D1%80%D0%B0%D0%BB_%D0%A1%D0%BB%D0%BE%D0%BA%D0%B0%D0%BC&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0413\u0435\u043d\u0435\u0440\u0430\u043b \u0421\u043b\u043e\u043a\u0430\u043c (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0413\u0435\u043d\u0435\u0440\u0430\u043b \u0421\u043b\u043e\u043a\u0430\u043c<\/a>\u00bb (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D1%8F%D0%B7%D1%8B%D0%BA\" title=\"\u0410\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 \u044f\u0437\u044b\u043a\">\u0430\u043d\u0433\u043b.<\/a>&#160;<a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%C2%ABGeneral_Slocum%C2%BB&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u00abGeneral Slocum\u00bb (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u00abGeneral Slocum\u00bb<\/a> ) \u043f\u043e\u0433\u0438\u0431\u043b\u043e \u0431\u043e\u043b\u0435\u0435 100 \u0447\u0435\u043b\u043e\u0432\u0435\u043a .<ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1907_%D0%B3%D0%BE%D0%B4\" title=\"1907 \u0433\u043e\u0434\">1907<\/a>&#160;\u2014 \u043d\u0430\u0447\u0430\u043b\u0430 \u0441\u0432\u043e\u044e \u0440\u0430\u0431\u043e\u0442\u0443 II \u043c\u0438\u0440\u043d\u0430\u044f \u043a\u043e\u043d\u0444\u0435\u0440\u0435\u043d\u0446\u0438\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D0%B0%D0%B3%D0%B0\" title=\"\u0413\u0430\u0430\u0433\u0430\">\u0413\u0430\u0430\u0433\u0435<\/a>, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u043f\u0440\u0438\u043d\u044f\u043b\u0438 \u0443\u0447\u0430\u0441\u0442\u0438\u0435 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043b\u0438 44 \u0441\u0442\u0440\u0430\u043d. \u0415\u0451 \u0441\u043e\u0437\u044b\u0432 \u0432\u043d\u043e\u0432\u044c \u0431\u044b\u043b \u043f\u0440\u0435\u0434\u043f\u0440\u0438\u043d\u044f\u0442 \u043f\u043e \u0438\u043d\u0438\u0446\u0438\u0430\u0442\u0438\u0432\u0435 \u0420\u043e\u0441\u0441\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1911_%D0%B3%D0%BE%D0%B4\" title=\"1911 \u0433\u043e\u0434\">1911<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0430 \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u044f \u00abComputing-Tabulating-Recording Company\u00bb, \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u0430\u044f \u0441\u0435\u0433\u043e\u0434\u043d\u044f \u043f\u043e\u0434 \u0438\u043c\u0435\u043d\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/IBM\" title=\"IBM\">IBM<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%81%D0%BC%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u041e\u0441\u043c\u0430\u043d\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u041e\u0441\u043c\u0430\u043d\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f<\/a> \u0443\u0441\u0442\u0440\u043e\u0438\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BD%D0%BE%D1%86%D0%B8%D0%B4\" title=\"\u0413\u0435\u043d\u043e\u0446\u0438\u0434\">\u0433\u0435\u043d\u043e\u0446\u0438\u0434<\/a> \u043f\u0440\u043e\u0442\u0438\u0432 \u043a\u0443\u0440\u0434\u043e\u0432-\u0435\u0437\u0438\u0434\u043e\