\u0438<\/a> \u0437\u0430\u043f\u0440\u0435\u0449\u0435\u043d\u0430 \u043f\u0440\u043e\u0434\u0430\u0436\u0430 \u00ab\u041a\u043e\u043a\u0430-\u041a\u043e\u043b\u044b\u00bb \u0438\u0437-\u0437\u0430 \u043f\u043e\u0432\u044b\u0448\u0435\u043d\u043d\u043e\u0433\u043e \u0443\u0440\u043e\u0432\u043d\u044f \u0445\u0438\u043c\u0438\u043a\u0430\u0442\u043e\u0432 \u0432 \u043d\u0435\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2000_%D0%B3%D0%BE%D0%B4\" title=\"2000 \u0433\u043e\u0434\">2000<\/a>&#160;\u2014 \u0432\u0435\u0442\u0435\u0440\u0430\u043d\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BC%D0%B8%D1%82%D0%B5%D1%82_%D0%B3%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D0%BE%D0%B9_%D0%B1%D0%B5%D0%B7%D0%BE%D0%BF%D0%B0%D1%81%D0%BD%D0%BE%D1%81%D1%82%D0%B8_%D0%A1%D0%A1%D0%A1%D0%A0\" title=\"\u041a\u043e\u043c\u0438\u0442\u0435\u0442 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0431\u0435\u0437\u043e\u043f\u0430\u0441\u043d\u043e\u0441\u0442\u0438 \u0421\u0421\u0421\u0420\">\u041a\u0413\u0411<\/a> \u043f\u0440\u0438\u0437\u0432\u0430\u043b\u0438 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u044c \u043f\u0430\u043c\u044f\u0442\u043d\u0438\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B7%D0%B5%D1%80%D0%B6%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9,_%D0%A4%D0%B5%D0%BB%D0%B8%D0%BA%D1%81_%D0%AD%D0%B4%D0%BC%D1%83%D0%BD%D0%B4%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0414\u0437\u0435\u0440\u0436\u0438\u043d\u0441\u043a\u0438\u0439, \u0424\u0435\u043b\u0438\u043a\u0441 \u042d\u0434\u043c\u0443\u043d\u0434\u043e\u0432\u0438\u0447\">\u0414\u0437\u0435\u0440\u0436\u0438\u043d\u0441\u043a\u043e\u043c\u0443<\/a>.<\/li><\/ul><h3>XXI \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2001_%D0%B3%D0%BE%D0%B4\" title=\"2001 \u0433\u043e\u0434\">2001<\/a>&#160;\u2014 \u043b\u0438\u0434\u0435\u0440\u0430\u043c\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D1%82%D0%B0%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%9D%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D0%B0%D1%8F_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u041a\u0438\u0442\u0430\u0439\u0441\u043a\u0430\u044f \u041d\u0430\u0440\u043e\u0434\u043d\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u041a\u0438\u0442\u0430\u044f<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0438<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%B7%D0%B0%D1%85%D1%81%D1%82%D0%B0%D0%BD\" title=\"\u041a\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043d\">\u041a\u0430\u0437\u0430\u0445\u0441\u0442\u0430\u043d\u0430<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B0%D0%B4%D0%B6%D0%B8%D0%BA%D0%B8%D1%81%D1%82%D0%B0%D0%BD\" title=\"\u0422\u0430\u0434\u0436\u0438\u043a\u0438\u0441\u0442\u0430\u043d\">\u0422\u0430\u0434\u0436\u0438\u043a\u0438\u0441\u0442\u0430\u043d\u0430<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D1%80%D0%B3%D0%B8%D0%B7%D0%B8%D1%8F\" title=\"\u041a\u0438\u0440\u0433\u0438\u0437\u0438\u044f\">\u041a\u0438\u0440\u0433\u0438\u0437\u0438\u0438<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%B7%D0%B1%D0%B5%D0%BA%D0%B8%D1%81%D1%82%D0%B0%D0%BD\" title=\"\u0423\u0437\u0431\u0435\u043a\u0438\u0441\u0442\u0430\u043d\">\u0423\u0437\u0431\u0435\u043a\u0438\u0441\u0442\u0430\u043d\u0430<\/a> \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B0%D0%BD%D1%85%D0%B0%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D1%80%D0%B3%D0%B0%D0%BD%D0%B8%D0%B7%D0%B0%D1%86%D0%B8%D1%8F_%D1%81%D0%BE%D1%82%D1%80%D1%83%D0%B4%D0%BD%D0%B8%D1%87%D0%B5%D1%81%D1%82%D0%B2%D0%B0\" title=\"\u0428\u0430\u043d\u0445\u0430\u0439\u0441\u043a\u0430\u044f \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f \u0441\u043e\u0442\u0440\u0443\u0434\u043d\u0438\u0447\u0435\u0441\u0442\u0432\u0430\">\u0428\u0430\u043d\u0445\u0430\u0439\u0441\u043a\u0430\u044f \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f \u0441\u043e\u0442\u0440\u0443\u0434\u043d\u0438\u0447\u0435\u0441\u0442\u0432\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2004_%D0%B3%D0%BE%D0%B4\" title=\"2004 \u0433\u043e\u0434\">2004<\/a><ul><li>\u041a\u043e\u043d\u0433\u0440\u0435\u0441\u0441 \u0421\u0428\u0410 \u0440\u0430\u0437\u0440\u0435\u0448\u0438\u043b \u043e\u0442\u043b\u043e\u0436\u0438\u0442\u044c \u043d\u0430 \u0433\u043e\u0434 \u0432\u0432\u0435\u0434\u0435\u043d\u0438\u0435 \u043f\u0430\u0441\u043f\u043e\u0440\u0442\u043e\u0432 \u0441 \u0431\u0438\u043e\u043c\u0435\u0442\u0440\u0438\u0447\u0435\u0441\u043a\u0438\u043c\u0438 \u0434\u0430\u043d\u043d\u044b\u043c\u0438 \u0434\u043b\u044f \u0432\u044a\u0435\u0437\u0434\u0430 \u0433\u0440\u0430\u0436\u0434\u0430\u043d 27 \u0441\u0442\u0440\u0430\u043d. \u0422\u0435\u043f\u0435\u0440\u044c \u044d\u0442\u043e \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u0434\u043e\u043b\u0436\u0435\u043d \u043e\u0434\u043e\u0431\u0440\u0438\u0442\u044c \u0421\u0435\u043d\u0430\u0442. \u041d\u0430 \u043e\u0442\u043c\u0435\u043d\u0435 \u044d\u0442\u043e\u0433\u043e \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u044f \u043d\u0430\u0441\u0442\u0430\u0438\u0432\u0430\u043b\u0438 \u0435\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u0438\u0435 \u0441\u0442\u0440\u0430\u043d\u044b, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0437\u0430 \u0434\u0430\u043d\u043d\u044b\u0439 \u0421\u0428\u0410 \u0441\u0440\u043e\u043a (\u0434\u043e 30 \u0441\u0435\u043d\u0442\u044f\u0431\u0440\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/2004_%D0%B3%D0%BE%D0%B4\" title=\"2004 \u0433\u043e\u0434\">2004 \u0433\u043e\u0434\u0430<\/a>) \u043d\u0435 \u043c\u043e\u0433\u043b\u0438 \u0437\u0430\u043c\u0435\u043d\u0438\u0442\u044c \u0432\u0441\u0435 \u043f\u0430\u0441\u043f\u043e\u0440\u0442\u0430. \u0412 \u0441\u0432\u043e\u044e \u043e\u0447\u0435\u0440\u0435\u0434\u044c \u0434\u043b\u044f \u0433\u0440\u0430\u0436\u0434\u0430\u043d, \u0432 \u043d\u0430\u0441\u0442\u043e\u044f\u0449\u0435\u0435 \u0432\u0440\u0435\u043c\u044f \u0432\u044a\u0435\u0437\u0436\u0430\u044e\u0449\u0438\u0445 \u0432 \u0421\u0428\u0410 \u0431\u0435\u0437 \u0432\u0438\u0437\u044b, \u043e\u043d\u0430 \u0434\u043e\u043b\u0436\u043d\u0430 \u0431\u044b\u043b\u0430 \u043f\u0440\u043e\u0441\u0442\u0430\u0432\u043b\u044f\u0442\u044c\u0441\u044f \u0432 \u0441\u0442\u0430\u0440\u044b\u0439 \u043f\u0430\u0441\u043f\u043e\u0440\u0442. \u0422\u0430\u043a\u0438\u043c \u043e\u0431\u0440\u0430\u0437\u043e\u043c, \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0435 \u043a\u043e\u043d\u0441\u0443\u043b\u044c\u0441\u043a\u0438\u0435 \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u044f \u043d\u0435 \u0441\u043c\u043e\u0433\u043b\u0438 \u0431\u044b \u0441\u043f\u0440\u0430\u0432\u0438\u0442\u044c\u0441\u044f \u0441 \u043d\u0430\u043f\u043b\u044b\u0432\u043e\u043c \u0434\u043e\u043a\u0443\u043c\u0435\u043d\u0442\u043e\u0432. \u0420\u0435\u0448\u0435\u043d\u0438\u0435 \u043a\u0430\u0441\u0430\u0435\u0442\u0441\u044f 22 \u0441\u0442\u0440\u0430\u043d \u0415\u0421, \u0430 \u0442\u0430\u043a\u0436\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D0%B2%D0%B0%D1%8F_%D0%97%D0%B5%D0%BB%D0%B0%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u041d\u043e\u0432\u0430\u044f \u0417\u0435\u043b\u0430\u043d\u0434\u0438\u044f\">\u041d\u043e\u0432\u043e\u0439 \u0417\u0435\u043b\u0430\u043d\u0434\u0438\u0438<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u0432\u0441\u0442\u0440\u0430\u043b\u0438\u044f\">\u0410\u0432\u0441\u0442\u0440\u0430\u043b\u0438\u0438<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D0%BD%D0%B3%D0%B0%D0%BF%D1%83%D1%80\" title=\"\u0421\u0438\u043d\u0433\u0430\u043f\u0443\u0440\">\u0421\u0438\u043d\u0433\u0430\u043f\u0443\u0440\u0430<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D1%83%D0%BD%D0%B5%D0%B9\" title=\"\u0411\u0440\u0443\u043d\u0435\u0439\">\u0411\u0440\u0443\u043d\u0435\u044f<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BF%D0%BE%D0%BD%D0%B8%D1%8F\" title=\"\u042f\u043f\u043e\u043d\u0438\u044f\">\u042f\u043f\u043e\u043d\u0438\u0438<\/a>.<\/li><li>\u041e\u0431\u043d\u0430\u0440\u0443\u0436\u0435\u043d \u043f\u0435\u0440\u0432\u044b\u0439 \u0441\u0435\u0442\u0435\u0432\u043e\u0439 \u0432\u0438\u0440\u0443\u0441 \u0434\u043b\u044f \u043c\u043e\u0431\u0438\u043b\u044c\u043d\u044b\u0445 \u0442\u0435\u043b\u0435\u0444\u043e\u043d\u043e\u0432&#160;\u2014 Cabir.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2007_%D0%B3%D0%BE%D0%B4\" title=\"2007 \u0433\u043e\u0434\">2007<\/a>&#160;\u2014 \u0441 \u043a\u043e\u0441\u043c\u043e\u0434\u0440\u043e\u043c\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%B9%D0%BA%D0%BE%D0%BD%D1%83%D1%80\" title=\"\u0411\u0430\u0439\u043a\u043e\u043d\u0443\u0440\">\u0411\u0430\u0439\u043a\u043e\u043d\u0443\u0440<\/a> \u0441 \u043f\u043e\u043c\u043e\u0449\u044c\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D0%BA%D0%B5%D1%82%D0%B0-%D0%BD%D0%BE%D1%81%D0%B8%D1%82%D0%B5%D0%BB%D1%8C\" title=\"\u0420\u0430\u043a\u0435\u0442\u0430-\u043d\u043e\u0441\u0438\u0442\u0435\u043b\u044c\">\u0440\u0430\u043a\u0435\u0442\u044b-\u043d\u043e\u0441\u0438\u0442\u0435\u043b\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%BD%D0%B5%D0%BF%D1%80_(%D1%80%D0%B0%D0%BA%D0%B5%D1%82%D0%B0-%D0%BD%D0%BE%D1%81%D0%B8%D1%82%D0%B5%D0%BB%D1%8C)\" title=\"\u0414\u043d\u0435\u043f\u0440 (\u0440\u0430\u043a\u0435\u0442\u0430-\u043d\u043e\u0441\u0438\u0442\u0435\u043b\u044c)\">\u0414\u043d\u0435\u043f\u0440<\/a> \u0437\u0430\u043f\u0443\u0449\u0435\u043d \u043d\u0435\u043c\u0435\u0446\u043a\u0438\u0439 \u0441\u043f\u0443\u0442\u043d\u0438\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/TerraSAR-X\" title=\"TerraSAR-X\">TerraSAR-X<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2008_%D0%B3%D0%BE%D0%B4\" title=\"2008 \u0433\u043e\u0434\">2008<\/a>&#160;\u2014 \u0432 \u0421\u0435\u0432\u0430\u0441\u0442\u043e\u043f\u043e\u043b\u0435 \u043e\u0442\u043a\u0440\u044b\u0442 \u043f\u0430\u043c\u044f\u0442\u043d\u0438\u043a \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u0440\u0438\u0446\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%BA%D0%B0%D1%82%D0%B5%D1%80%D0%B8%D0%BD%D0%B0_II\" title=\"\u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0430 II\">\u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0435 II<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2009_%D0%B3%D0%BE%D0%B4\" title=\"2009 \u0433\u043e\u0434\">2009<\/a>&#160;\u2014 \u043e\u0442\u043a\u0440\u044b\u0442\u0438\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%BA%D0%B0%D1%82%D0%B5%D1%80%D0%B8%D0%BD%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0431\u0443\u0440\u0433\">\u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0431\u0443\u0440\u0433\u0435<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BC%D0%BC%D0%B8%D1%82\" title=\"\u0421\u0430\u043c\u043c\u0438\u0442\">\u0441\u0430\u043c\u043c\u0438\u0442\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%9E%D0%A1\" class=\"mw-redirect\" title=\"\u0428\u041e\u0421\">\u0428\u041e\u0421<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2012_%D0%B3%D0%BE%D0%B4\" title=\"2012 \u0433\u043e\u0434\">2012<\/a>&#160;\u2014 \u043f\u0440\u0435\u043c\u044c\u0435\u0440\u0430 \u043f\u0435\u0440\u0432\u043e\u0439 \u0441\u0435\u0440\u0438\u0438 \u043c\u0443\u043b\u044c\u0442\u0441\u0435\u0440\u0438\u0430\u043b\u0430 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B0%D0%B2%D0%B8%D1%82%D0%B8_%D0%A4%D0%BE%D0%BB%D0%B7\" title=\"\u0413\u0440\u0430\u0432\u0438\u0442\u0438 \u0424\u043e\u043b\u0437\">\u0413\u0440\u0430\u0432\u0438\u0442\u0438 \u0424\u043e\u043b\u0437<\/a>\u00bb (\u0440\u0435\u0436\u0438\u0441\u0441\u0451\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%B8%D1%80%D1%88,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81\" title=\"\u0425\u0438\u0440\u0448, \u0410\u043b\u0435\u043a\u0441\">\u0410\u043b\u0435\u043a\u0441 \u0425\u0438\u0440\u0448<\/a>).<\/li><\/ul><h2>"}